  input: 'TEXT,F3XA,,"On November 6, 2002, certain provisions of BCRA took effect.
    On July 29, 2002 the FEC issued and transmitted to Congress the final rules concerning
    prohibited and excessive contributions: non-federal funds or soft money.  The
    effective date for these rules was set for November 6, 2002, except for 11 CFR
    106.7(a) which was set for January 1, 2003.  Included in these rule changes were
    the way state party committees determined their allocation ratio for certain joint-activities.  The
    fixed percentages would vary only in terms of whether or not a Presidential campaign
    and/or Senate campaign is to be held in a particular election cycle.  Therefore,
    in accordance with the new 11 CFR 106.7(d)(2)(iii), the Tennessee Democratic Party
    began allocating its administrative costs after November 5, 2002 with no less
    than 21 percent to its Federal account.  Per guidance from the Commission, no
    new Schedule H1 was submitted.  The new ratios are reflected in applicable expenditures
    in Schedule H4 of the 30 day post-general and Year End Report."'
